const projects = [
  {
    title: 'Project One',
    image: 'https://via.placeholder.com/400x250',
    description: 'A modern landing page built with React.',
    link: '#'
  },
  {
    title: 'Project Two',
    image: 'https://via.placeholder.com/400x250',
    description: 'A full-featured eCommerce UI using Tailwind.',
    link: '#'
  }
];

export default function Portfolio() {
  return (
    <section className="max-w-6xl mx-auto py-20 px-4">
      <h2 className="text-3xl font-bold mb-10">My Projects</h2>
      <div className="grid gap-8 md:grid-cols-2">
        {projects.map((project, index) => (
          <div key={index} className="border rounded-lg overflow-hidden shadow hover:shadow-md transition">
            <img src={project.image} alt={project.title} className="w-full object-cover" />
            <div className="p-4">
              <h3 className="text-xl font-semibold mb-2">{project.title}</h3>
              <p className="text-gray-600 mb-4">{project.description}</p>
              <a href={project.link} className="text-blue-600 hover:underline">View Project</a>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
}
